import React from 'react'
import { file1 } from '../../Images/2011'
import './Gallery.css'
const Gallery1 = () => {
    return (
        <div>
            <h1 style={{ textAlign: 'center' }}>EEL 2011</h1>
            <div className='gallery'>
                {
                    file1.map((img, index) => {
                        return (
                            <div key={index} className='img'>
                                <img src={img.src} alt='error' />
                            </div>
                        )
                    })
                }
            </div>
        </div>
    )
}

export default Gallery1
